function removeUnnecessaryChars(str) {
    return str.replace(/[^a-zA-Z0-9\s\+\&\?\.\[\]:]/g, ' ');
}

async function loadHistory() {
    const keys = Object.keys(wallpapersstd);
    const randomKey = keys[Math.floor(Math.random() * keys.length)];
    const theme = (window.matchMedia && window.matchMedia('(prefers-color-scheme: dark)').matches) ? 'dark' : 'light';
    document.body.style.backgroundImage = `url(${wallpapersstd[randomKey][theme]})`;
    const container = document.getElementById('historydivs');

    const renderLink = ({ title, url, count }) => {
        const div = document.createElement('div');
        div.className = 'link';

        const badgeMatch = title.match(/\((.*?)\)/);
        const badgeNumber = badgeMatch ? badgeMatch[1].trim() : '';

        if (badgeNumber) {
            title = title.replace(`(${badgeNumber})`, '').trim();
        }

        const splitTitle = title.split(/[\|\-\:]/);

        

        const mainTitle = removeUnnecessaryChars(splitTitle[0].trim());
        const subtext = splitTitle.slice(1).join('').trim() || new URL(url).hostname;

        const button = document.createElement('thing');
        button.onclick = () => window.open(url, '_blank');
        button.innerHTML = mainTitle;

        if (badgeNumber) {
            const badgeDiv = document.createElement('div');
            badgeDiv.className = 'badge';
            badgeDiv.innerHTML = badgeNumber;
            button.appendChild(badgeDiv);
        }

        const subtextDiv = document.createElement('div');
        subtextDiv.className = 'subtext';
        subtextDiv.innerHTML = subtext;

        button.title = url;

        button.appendChild(subtextDiv);
        div.appendChild(button);
        container.appendChild(div);

        return count + 1;
    };

    // Sample search and rendering
    chrome.history.search({ text: '', maxResults: 80 }, async (results) => {
        const visited = new Map();
        const majorTitleCount = new Map();
        const keywordCount = new Map();

        results.forEach(({ title, url, visitCount }) => {
            const majorTitle = title.split(/[\|\-\:]/)[0].trim();

            if (
                (!visited.has(title) || visitCount > visited.get(title).visitCount) &&
                (majorTitleCount.get(majorTitle) || 0) < 3
            ) {
                visited.set(title, { title, url, visitCount });
                majorTitleCount.set(majorTitle, (majorTitleCount.get(majorTitle) || 0) + 1);
            }

            // Extract and count keywords in the title
            const words = title.toLowerCase().split(/\W+/).filter(word => word.length > 2); // Filter out small words like "the", "and", etc.
            words.forEach(word => {
                keywordCount.set(word, (keywordCount.get(word) || 0) + 1);
            });
        });

        // Sort visited results by visit count and limit to top 10
        const sorted = Array.from(visited.values())
            .sort((a, b) => b.visitCount - a.visitCount)
            .slice(0, 10);

        // Render the links
        let count = 0;
        sorted.forEach(({ title, url }) => {
            count = renderLink({ title, url, count });
        });

        const sources = new Set();
        sorted.forEach(({ title }) => {
            const source = title.split(/[\|\-\:]/)[0].trim();
            sources.add(removeUnnecessaryChars(source).trim());
        });

        const sourceArray = Array.from(sources).slice(0, 5);
        const summary = `Write what you did with ${sourceArray.join(', ')}${sources.size > 3 ? ', and more' : ''}...`;

        document.querySelectorAll(".CodeMirror-placeholder")[0].textContent = summary;
    });
}

loadHistory();